  \"Stochastic Queuing Model Analysis to Support Airspace Super Density Operations
  (ASDO) Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T03:33:53.299541\",\n\t\"name\": \"stochastic-queuing-model-analysis-to-support-airspace-super-density-operations-asdo-projec\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"NASA has been involved in extensive research
  efforts to develop advanced concepts, technologies, and procedures for the Next
  Generation Air Transportation System (NextGen). The research focus area Airspace
  Super-Density Operations (ASDO) pertains to highly efficient operations at the busiest
  airports and terminal airspace. Deterministic analysis of the proposed NextGen concepts
  may not be sufficient, as inability of aircraft to adhere to flight schedules exactly
  and operational uncertainties may significantly alter the effectiveness of the proposed
  concepts.  rnThe primary objective of this research proposal is to create a High-Fidelity
  Queuing Model of the Terminal Area and a Framework for Performing Time-Varying Stochastic
  Analysis of Terminal Area Operations with regards to Input Schedule and Operational
  Uncertainties. This Queuing Model can be used to evaluate the interaction and combined
  performance of multiple NextGen concepts in the ASDO research focus area. rnThe
  Phase I effort will develop a sample Queuing Network Model for a moderately complex
  terminal area, e.g. JFK. The utility of the developed Queuing Model and Analysis
  Techniques will be illustrated using two case-studies in the JFK terminal area.
  Phase II research effort proposes to develop integrated surface/terminal area queuing
  model of a Metroplex. Stochastic analysis of the Metroplex will be accelerated in
  Phase II using Graphics Processing Units.\",\n\t\"license_title\": \"U.S. Government
